import React from 'react';
import { styled } from 'styled-components';

const Button = styled.div`
  position: fixed;
  bottom: 100px;
  right: 50px;
  width: 60px;
  height: 60px;
  display: flex;
  img {
    width: 100%;
    height: 100%;
    border: 1px solid #000;
    border-radius: 50%;
    background-color: #FFF000;
  }
`;

const AsideBtn = () => {
  return (
    <Button>
      <img src='https://wiisnt.co.kr/images/cm_logo_1_02.svg'/>
    </Button>
  )
}

export default AsideBtn;
